(29, NULL, 1, '0', 'PLA will be closed from 01 May, 2022 to 05 May, 2022', 'Dear All,\r\nWe would like to announce that Prediction Learning Associates Ltd. 1st May will be closed due to May Day and due to EID-UL-FITR-2022 we will keep our office closed from 2nd May, 2022 to 05th May, 2022. We will soon return to work on 7th May, 2022 with regular working hours starting from 09.00 am to 06.00 pm.\r\nThank you for your understanding.\r\nWishing you a Happy Eid , we hope you will have a great time with your friends and family, Blessings and happy Eid-ul-Fitr.\r\nEid Mubarak!\r\nRegards,\r\nHR & Admin Department', 7985, '2022-04-22 22:54:44', '2022-04-22 22:54:44');
