(141, 1, NULL, 7977, 'Mahbub Alam', NULL, 'Leave', 'Leave for Mahbub Alam', 'Dear Sir,\r\n\r\nI am writing this message  with reference to my remaining annual leave quota.\r\n\r\nI am not feeling well today.  Sometimes it seems like I can not hold my balance while walking is the reason why I decided to take rest today.      \r\nI request you to consider my leave request. During my absence, I can be reached at my phone number. \r\n\r\nYours sincerely,\r\n\r\nMd. Mahbub Alam', '2022-04-18', '2022-04-18', NULL, '2022-04-17 21:53:57', '2022-04-17 21:53:57'),
(142, 1, NULL, 7986, 'Md. Ataul Ahsan Ali', NULL, 'Leave', 'Leave for Md. Ataul Ahsan Ali', 'Dear sir,\r\n\r\n\r\nI humbly inform you that I am suffering from food poisoning and vomiting. Due to this sudden illness, it was not possible for me to report to the office on 17th April 2022. This serious condition has greatly affected my health. I hope you will consider my application and allow me to leave on 17th  April 2022. I will be grateful for this kindness.\r\n\r\nYours Truly,\r\nMd. Ataul Ahsan Ali', '2022-04-17', '2022-04-17', NULL, '2022-04-18 03:38:54', '2022-04-18 03:38:54'),
(143, 1, NULL, 7983, 'Rupa Aktar', NULL, 'Leave', 'Leave for Rupa Aktar', 'Dear Sir,\r\nAssalamuwalaikum.\r\nI am not feeling good today so may I not be able to attend today.\r\nKindly grant me one day of sick leave.\r\n\r\nYours sincerely\r\nRupa Aktar\r\nHR Analyst', '2022-04-16', '2022-04-16', NULL, '2022-04-18 22:15:01', '2022-04-18 22:15:01'),
(144, 1, NULL, 7979, 'Jubayer Mahmud Mulla', NULL, 'Leave', 'Leave for Jubayer Mahmud Mulla', 'Dear Sir,\r\nTake my salam. I would like to take leave for one day due to my exam. Please approve my leave.\r\nRegards,\r\nJubayer Mahmud Mulla\r\nSr. Associate - HR & Admin', '2022-04-02', '2022-04-02', NULL, '2022-04-18 22:15:07', '2022-04-18 22:15:07'),
(145, 1, 'ttvGzXRENh0X3oMvfjBOvEril', NULL, NULL, 'Yes', 'Holiday', 'May Day', NULL, '2022-05-01', '2022-05-01', NULL, '2022-04-22 22:04:22', '2022-04-22 22:04:22'),
(148, 1, 'GPxCdmPJly2kroyEl6Oaie5cT', NULL, NULL, 'Yes', 'Holiday', 'EID-UL-FITR-2022', NULL, '2022-05-02', '2022-05-06', NULL, '2022-04-22 22:10:38', '2022-04-22 22:10:38'),
(149, 1, NULL, 7983, 'Rupa Aktar', NULL, 'Leave', 'Leave for Rupa Aktar', 'I want to go home for \"Eid Festival\", but my home is so far from Dhaka so I need one day\'s leave.\r\nKindly grant me one day of casual leave.\r\nThanks & REgards\r\nRupa Aktar\r\nHR Analyst', '2022-04-30', '2022-04-30', NULL, '2022-04-25 22:20:26', '2022-04-25 22:20:26'),
(150, 1, NULL, 7978, 'Md. Rakibul Hasan', NULL, 'Leave', 'Leave for Md. Rakibul Hasan', 'I want to go to my native place for Eid al-Fitr. Therefore, I request 1 day leave 30th April before Eid al-Fitr. Please grant the required leaves. I will be thankful to you.', '2022-04-30', '2022-04-30', NULL, '2022-04-26 22:45:28', '2022-04-26 22:45:28'),
(151, 1, NULL, 7980, 'Md Ibrahim Biswas', NULL, 'Leave', 'Leave for Md Ibrahim Biswas', 'I want to go to my native place for Eid al-Fitr. Therefore, I request 1 day of leave on 30th April before Eid al-Fitr. Please grant the required leaves.', '2022-04-30', '2022-04-30', NULL, '2022-04-28 04:42:32', '2022-04-28 04:42:32'),
