(99, 'NQ85Fq7gjkQffZoB44C0GSS7z7977', 4, 1, 8, 8, 7977, 7976, NULL, '2022-04-18', '2022-04-18', 1, 'Dear Sir,\r\n\r\nI am writing this message  with reference to my remaining annual leave quota.\r\n\r\nI am not feeling well today.  Sometimes it seems like I can not hold my balance while walking is the reason why I decided to take rest today.      \r\nI request you to consider my leave request. During my absence, I can be reached at my phone number. \r\n\r\nYours sincerely,\r\n\r\nMd. Mahbub Alam', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-17 21:41:55', '2022-04-17 21:53:57'),
(100, 'eVYO8LCVKrMS3M5TERNgc2qPk7986', 4, 1, 15, 19, 7986, 7976, NULL, '2022-04-17', '2022-04-17', 1, 'Dear sir,\r\n\r\n\r\nI humbly inform you that I am suffering from food poisoning and vomiting. Due to this sudden illness, it was not possible for me to report to the office on 17th April 2022. This serious condition has greatly affected my health. I hope you will consider my application and allow me to leave on 17th  April 2022. I will be grateful for this kindness.\r\n\r\nYours Truly,\r\nMd. Ataul Ahsan Ali', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-18 02:12:45', '2022-04-18 03:38:54'),
(101, 'YkIyQKXGukgWcbKAkJDMQSVB67983', 4, 1, 10, 12, 7983, 7976, NULL, '2022-04-16', '2022-04-16', 1, 'Dear Sir,\r\nAssalamuwalaikum.\r\nI am not feeling good today so may I not be able to attend today.\r\nKindly grant me one day of sick leave.\r\n\r\nYours sincerely\r\nRupa Aktar\r\nHR Analyst', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-18 21:22:36', '2022-04-18 22:15:01'),
(103, '1zG23lEOLxLmiMDMhVzA4l5Mf7979', 5, 1, 9, 10, 7979, 7976, NULL, '2022-04-02', '2022-04-02', 1, 'Dear Sir,\r\nTake my salam. I would like to take leave for one day due to my exam. Please approve my leave.\r\nRegards,\r\nJubayer Mahmud Mulla\r\nSr. Associate - HR & Admin', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-18 21:40:27', '2022-04-18 22:15:07'),
(104, 's4ZkTn1cUxc2vjMQKJ8w7i7J37983', 5, 1, 15, 12, 7983, 7976, NULL, '2022-04-30', '2022-04-30', 1, 'I want to go home for \"Eid Festival\", but my home is so far from Dhaka so I need one day\'s leave.\r\nKindly grant me one day of casual leave.\r\nThanks & REgards\r\nRupa Aktar\r\nHR Analyst', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-25 04:48:56', '2022-04-25 22:20:26'),
(105, 'mUAnuLpwUXke0dtPqwn4CQzLn7978', 5, 1, 8, 9, 7978, 7977, 7976, '2022-04-30', '2022-04-30', 1, 'I want to go to my native place for Eid al-Fitr. Therefore, I request 1 day leave 30th April before Eid al-Fitr. Please grant the required leaves. I will be thankful to you.', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-26 22:44:16', '2022-04-26 22:45:28'),
(106, 'jRs2GaJo6DtpJQef9BJsvIGEa7980', 5, 1, 15, 15, 7980, 7979, 7976, '2022-04-30', '2022-04-30', 1, 'I want to go to my native place for Eid al-Fitr. Therefore, I request 1 day of leave on 30th April before Eid al-Fitr. Please grant the required leaves.', NULL, 'Approved', 147, 5, 6, 4, 5, NULL, 0, '2022-04-28 04:28:53', '2022-04-28 04:42:32'),
